    render () {
        return (
            <div className="container">
                <h5 className="center"></h5>
                <form onSubmit={ this.handleSubmit }>
                <label>
            <Select
              options={this.state.options}
              value={this.state.value}
              onChange={this.changeHandler}
              />
          </label>
                </form>
                <Map></Map>
            </div>
        )
    }
}
export default Home
